window.bookSummaryJSON = "<p><b>The latest installment of Audible’s blockbuster addition to the Sherlock Holmes universe, now featuring Dame Helen Mirren in a deliciously villainous performance, with Dominic Monaghan and Phil LaMarr returning to their leading roles.</b></p> <p>Professor James Moriarty (Monaghan) is back for a gripping new adventure that finds him joining forces with his bitter rival, Sherlock Holmes (LaMarr). Moriarty tracks down the woman he loves but discovers that she is trapped in the web of a shadowy cabal of evil that’s growing stronger every day. To fight it, Moriarty must face Lady Milverton (Mirren), a ruthless mastermind whose blackmail poisons the highest levels of power. When he learns that his nemesis Sherlock Holmes is also in Milverton’s grip, the two must set their animosity aside to stop an escalating threat of world war.</p> <p>The all-star cast’s performances, paired with a meticulously crafted sound design, make <i>Moriarty: The Silent Order</i> a truly electrifying audio experience. Come for the heart-pounding thrills, and stay for the biting wit and shocking twists. You’ve been warned: The game is once again afoot.</p>"; 
